import React from 'react';
import './CategoryIcons.scss';

const CategoryIcons: React.FC = () => {
  const categories = [
    { id: 'tecnologia', name: 'Tecnologia', icon: './public/pc.png', active: true },
    { id: 'supermercado', name: 'Supermercado', icon: 'üõí' },
    { id: 'bebidas', name: 'Bebidas', icon: 'ü•§' },
    { id: 'ferramentas', name: 'Ferramentas', icon: 'üîß' },
    { id: 'saude', name: 'Sa√∫de', icon: '‚ù§Ô∏è' },
    { id: 'esportes', name: 'Esportes e Fitness', icon: 'üèÉ' },
    { id: 'moda', name: 'Moda', icon: 'üëó' },
    { id: 'outros', name: 'Outros', icon: 'üì¶' }
  ];

  return (
    <section className="category-icons">
      <div className="category-container">
        {categories.map((category) => (
          <div 
            key={category.id} 
            className={`category-card ${category.active ? 'active' : ''}`}
          >
            <div className="category-icon">{category.icon}</div>
            <span className="category-name">{category.name}</span>
          </div>
        ))}
      </div>
    </section>
  );
};

export default CategoryIcons;
